// Bootstrap CSS
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.min.js";
import Navbar from "./Components/Navbar";
import News from "./Components/News";
import "./App.css";
import {BrowserRouter,
        Routes,
        Route}
        from "react-router-dom"

function App() {
  return (
    <>
    <BrowserRouter>
    <Navbar/>
    {/* <News key="general" category="sports"/> */}
    <Routes>
      <Route path="/" element={ <News key="general" category="general"/> } />
      <Route path="/" element={ <News key="business" category="business"/> } />
      <Route path="/" element={ <News key="sportsl" category="sports"/> } />
      <Route path="/" element={ <News key="technology" category="technology"/> } />
      <Route path="/" element={ <News key="science" category="science"/> } />
      <Route path="/" element={ <News key="health" category="health"/> } />
      <Route path="/" element={ <News key="entertainment" category="entertainment"/> } />
    </Routes>
    </BrowserRouter>
    </>
  )
}

export default App;

